    renderComponent(){
        return  <div>
            <div>
            <button onClick={()=>{histroy.push("/home")}}>back</button>
                    <DisplayWallet />
                    </div>
                    <div>
                    <Transaction/>
                </div>
            </div>
    }

    render(){
        console.log(this.props)
        return <div style={{"margin-left":"10%"}}>
            {
                this.props.username ? this.renderComponent() : "Illegal access to this page"
            }


        </div>
    }
}

